    /********************************************************
     * @description 根据客户端环境 处理图片路径的方法 等待处理
     */
    var _getImgPath = function _getImgPath(imgName) {
      var userAgent = cc11001100_hook("userAgent", window.navigator.userAgent.toLowerCase(), "var-init");
      var platform = cc11001100_hook("platform", window.navigator.platform, "var-init");
      // console.log('查看传进来的参数ImgName==='+imgName)

      // console.log('查看当前环境安卓'+userAgent.match(/android/) )
      // console.log('查看当前环ios'+userAgent.match(/android/) )
      //pc环境
      if (platform == 'Win32' || platform == 'MacIntel') {
        ///images/bjj.png
        if (/^\.\/images\//.test(imgName)) {
          return imgName;
        }
        return 'data:image/png;base64,' + imgName;
      }
      //安卓
      if (userAgent.match(/android/) && userAgent.match(/android/)[0] == 'android') {
        if (/^\/storage\//.test(imgName)) {
          return imgName;
        }
        return 'data:image/png;base64,' + imgName;
      }
      // ios
      if (userAgent.match(/iphone os/) && userAgent.match(/iphone os/)[0] == 'iphone os') {
        if (/^\/var\/mobile\//.test(imgName)) {
          return imgName;
        }
        return 'data:image/png;base64,' + imgName;
      }
    };

